If changing an existing definition:
- [X] Provide a URL to documentation or source code which provides context for the suggested changes: https://github.com/paulmillr/chokidar/blob/master/lib/nodefs-handler.js#L26
- [X] Increase the version number in the header if appropriate. (N/A)

Tested this with:
```js
const f = new (require("chokidar").FSWatcher)();
f.add("a.js");
f.on("raw", (event, path, details) => {
    console.log(event);
});
```
It outputs a string `"change"`. Might also be nice to change the type to a union if all possible events can be known.
